package com.twinflag.touch.model;import java.util.Date;public class LevelTwoBean {    private String id;    private Date updateTime;    private Integer levelOneId;    private String label;    private String title;    private String url;    private boolean isMany;    private Integer updateUserId;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getLabel() {        return label;    }    public void setLabel(String label) {        this.label = label;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public boolean isMany() {        return isMany;    }    public void setMany(boolean many) {        isMany = many;    }    public Date getUpdateTime() {        return updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    public Integer getLevelOneId() {        return levelOneId;    }    public void setLevelOneId(Integer levelOneId) {        this.levelOneId = levelOneId;    }    public Integer getUpdateUserId() {        return updateUserId;    }    public void setUpdateUserId(Integer updateUserId) {        this.updateUserId = updateUserId;    }}